import {useState, createContext } from 'react'


interface User {
    id: string
    email: string
    username: string
}
  
type ContextType = {
    todos: User
}

export const UserContext = createContext(null);

export const UserProvider: React.FC = ({ children }) => {
    const [user, setUser] = useState<User>({
        id: "",
        email: "",
        username: "",
    })

    return(
        {children}
    )
}

export default UserProvider;
